import React from 'react'
import poster from "../Images/netflix_poster.jpg";

const Home = () => {
  return (
    <div>
        <div class="bg-[url('../Images/netflix_poster.jpg')]"></div>
        <img src={poster} alt="poster" />
    </div>
  )
}

export default Home
